func testServiceToOneServiceBrokerUsingServiceBroker(t *testing.T) {
	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var local Service
	var foreign ServiceBroker

	seed := randomize.NewSeed()
	if err := randomize.Struct(seed, &local, serviceDBTypes, true, serviceColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Service struct: %s", err)
	}
	if err := randomize.Struct(seed, &foreign, serviceBrokerDBTypes, false, serviceBrokerColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize ServiceBroker struct: %s", err)
	}

	if err := foreign.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	queries.Assign(&local.ServiceBrokerID, foreign.ID)
	if err := local.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	check, err := local.ServiceBroker().One(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}

	if !queries.Equal(check.ID, foreign.ID) {
		t.Errorf("want: %v, got %v", foreign.ID, check.ID)
	}

	slice := ServiceSlice{&local}
	if err = local.L.LoadServiceBroker(ctx, tx, false, (*[]*Service)(&slice), nil); err != nil {
		t.Fatal(err)
	}
	if local.R.ServiceBroker == nil {
		t.Error("struct should have been eager loaded")
	}

	local.R.ServiceBroker = nil
	if err = local.L.LoadServiceBroker(ctx, tx, true, &local, nil); err != nil {
		t.Fatal(err)
	}
	if local.R.ServiceBroker == nil {
		t.Error("struct should have been eager loaded")
	}
}

